    false,nt"url": null,nt"notes": "This annual narrative report for the Wapello
    District of Mark Twain National Wildlife Refuge summarizes Refuge activities during
    the 1997 fiscal year.  The Louisa Division, the Horseshoe Bend Division, the Big
    Timber Division, the Islands Division, and the Keithsburg Division are included.
     The report begins with an introduction to the Refuge and a summary of the yearu2019s
    highlights and climatic conditions.  Information about monitoring and studies- including
    surveys and censuses- is provided next.  Habitat restoration and management projects
    are also covered; activities include water level management, mowing, farming, fire
    management, and vegetation control.  Coordination activities, such as interagency
    coordination and private land activities, are outlined.  The resource protection
    section provides information about law enforcement, contaminant investigation, permits,
    and land acquisition support.  Information about public education and recreation
    is given.  Finally, Refuge planning and administration are discussed.",nt"owner_org":
